import Vue from 'vue'
import VueRouter from 'vue-router'
import MyTest from '../components/MyTest.vue'

Vue.use(VueRouter)

const routes = [
  {
    path:'/',
    name:'test',
    component:MyTest
  }
]

const router = new VueRouter({
  routes
})

export default router
